    public int numSub2(String s) {
        int ans = 0;

        for(int i = 0; i < s.length();i++){
            if(s.substring(i,i+1).contains("1")){

                for(int j = i + 1 ;j <= s.length();j++){
                    String temp = s.substring(i,j);
                    if(temp.contains("0")){
                        break;
                    }else{
                        ans ++;
                    }
                }
            }else{
                continue;
            }
        }

        return (int )(ans % ((Math.pow(10, 9) + 7)));
    }
